import React, { Component } from 'react'
import Box from './Box'
import List from './List'

export default class Facade extends Component {
    render() {
        return (
            <div className="App">
                <header className="App-header">
                    <p>Todo App</p>
                    <Box/>
                    <List/>
                </header>
            </div>
        )
    }
}
